import { Component, OnInit } from '@angular/core';

@Component({
  selector: 'app-qlphantrang',
  templateUrl: './qlphantrang.component.html',
  styleUrls: ['./qlphantrang.component.css']
})
export class QlphantrangComponent {

  constructor(private http: HttpClient) { }

  getProducts() {
    return this.http.get('url-to-get-products');
  }
}
